import React, { useState } from 'react'

export const Surya = () => {
    const[name,setName] = useState('surya')
    function vikram (){
        setName('vikram')
    }
    function raghu (){
        setName('raghu')
    }
    function surya (){
        setName('surya')
    }
  return (

    <div>
        <h1></h1>
        <button>surya</button>
        <button onClick={vikram}>vikram</button>
        <button onClick={raghu}>raghu</button>
    
    </div>
  )
}
